export const Button: FC = () => {
  return (
    <>
      <Link to="/popup" className={styles.btnFont}>
        Tweet
      </Link>
      <Suspense fallback={<div>Loading...</div>}>
        {/* <Route path="/popup" component={Popup} /> */}
        <PopupTweet />
      </Suspense>
    </>
  )
}

export default Button
